css:
@-moz-document url-prefix("https://www.planttext.com/") {
body, #menu {
    background-color: #2e2e2e;
    color: rgba(255, 255, 255, 0.7);
}

.ui-widget-content, #newspop {
    background: #2e2e2e;
}


#sidebar, #addblock, #scratch, #setting, input {
    background-color: #212121;
}

#scratch, input[type=text], .ui-widget-content a {
    color: white;
}

#file-name-output, #file-name-output-pre, #setting, #newspop {
    color: rgba(255, 255, 255, 0.7);
}

}
